import React from 'react'
import classes from './AnimeCharacter.module.css'
import { Swiper, SwiperSlide, Navigation, Pagination  } from "swiper/react";
import tanjiro from '../assets/5ede49f9b760540004f2c5e7.png'

import Slider from 'react-slick';
export default function AnimeCharacter() {
  var settings = {
    dots: true,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    // autoplay: true,
    // autoplaySpeed: 2000,
    pauseOnHover: true
  };
  return (
   
    <Slider {...settings} className={classes['a-container']}>
    <div className={classes['slider-cont']}>
   
   <img src={tanjiro} alt='hi'/>
  
 </div>
     

    </Slider>
  
  )
}
